import { CardSection, CardContainer, Card, CardPreview, Status, Image, Pet, Species } from '../styled-components/CardElements'

const CardList = ({ cards }) => {
  return (
    <CardSection>
      <CardContainer>
        <Card>
          {cards.map((card) => (
            <CardPreview key={card.petCard._id}>
              <Status>{ card.petCard.status }</Status>
              <Image>Here</Image>
              <h2>" { card.petCard.petName } "</h2>
              <Pet>
                <p>{ card.petCard.breed }</p>
                <Species>{ card.petCard.species }</Species>
              </Pet>
            </CardPreview>
          ))}
        </Card>
      </CardContainer>
    </CardSection>
  )
}

export default CardList;
